import React from 'react';
import './App.css';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import Bar from "./components/Bar"

function App() {
  return (
    <div className="App">
       <CssBaseline />
      <Container maxWidth="sm">
        <Bar/>
        mep
      </Container>
    </div>
  );
}

export default App;
